import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';

const ListCom=(props)=>
{
    return;
    <div className="tosp style">
    <span>
        <DeleteIcon/>
    </span>
    <li>{props.text}</li>
    </div>;
}

export default ListCom;
